import { routes } from "../datas/Routes.js";

function NavBar({ isOpen }) {
  const listItems = routes.map((link) => (
    <li key={link.id} className="">
      <a className="hover:text-blueCustom duration-500" href={link.href}>
        {link.title}
      </a>
    </li>
  ));

  return (
    <nav
      className={`box-border bg-grayCustom w-full max-w-full absolute md:static transition-all duration-500 ease-in ${
        isOpen ? "top-20 opacity-100" : "top-[-490px] opacity-0"
      }`}
    >
        <ul className="flex flex-col lg:flex-row gap-4 text-base font-amstelvar p-0">
            {listItems}
         </ul>
    </nav>


  );
}

export default NavBar;
